// /src/components/ActorList.tsx
import React, { useState, useEffect } from 'react';
import { fetchActorsWithMultipleCharacters } from '../api/actorsApi';
import { useActorsWithMultipleCharacters } from '../hooks/useActors';

const ActorList = () => {
  const [actorsData, setActorsData] = useState<{ [actorName: string]: { movieName: string; characterName: string }[] }>({});
  const { data: moviesPerActor, loading, error } = useActorsWithMultipleCharacters();

  useEffect(() => {
    const getActorData = async () => {
      const data = await fetchActorsWithMultipleCharacters();
      setActorsData(data);
    };
    getActorData();
  }, []);

  return (
    <div>
      <h1>Actors with Multiple Characters</h1>
      <ul>
        {Object.keys(actorsData).map((actor) => (
          <li key={actor}>
            <h2>{actor}</h2>
            <ul>
              {actorsData[actor].map((entry, idx) => (
                <li key={idx}>
                  {entry.movieName} - {entry.characterName}
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ActorList;
